{"cells":[{"source":"<a href=\"https://www.kaggle.com/thaizdebique/google-capstone-cyclistic?scriptVersionId=87315425\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"4c0ac07d","metadata":{"papermill":{"duration":0.155268,"end_time":"2022-02-08T15:43:40.810695","exception":false,"start_time":"2022-02-08T15:43:40.655427","status":"completed"},"tags":[]},"source":["### Cyclistic Bike Share Analysis\n","Prepared by: Thaiz De Bique \n","\n","\n","## INTRODUCTION <a class=\"anchor\" id=\"INTRODUCTION\"></a>\n","\n","#### Brief Overview\n","\n","In this scenario, I am a data analyst working for a bike-sharing company \"Cyclistic\". The main objective is to gather meaningful insights that can be used to drive marketing strategy.\n","\n","The company's marketing strategy appeals to a broad spectrum of consumers. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members. Management believes that maximizing the number of annual members will be key to future growth (Google 2021).\n","\n","**NB. Cyclistic is a fictional company and the scenario is only being used to carry out the analysis.**\n","\n","\n","\n","#### Project deliverables are as follows; \n","\n","1. A clear statement of the business task\n","2. A description of all data sources used\n","3. Documentation of any cleaning or manipulation of data\n","4. A summary of your analysis\n","5. Supporting visualizations and key findings\n","6. Your top three recommendations based on your analysis\n"]},{"cell_type":"markdown","id":"7e8f873b","metadata":{"papermill":{"duration":0.153378,"end_time":"2022-02-08T15:43:41.115743","exception":false,"start_time":"2022-02-08T15:43:40.962365","status":"completed"},"tags":[]},"source":["## PHASE 1 - ASK  <a class=\"anchor\" id=\"ASK\"></a>\n","\n","#### Business Task\n","To explore the way in which casual riders and Cyclistic members use Cyclistic Bikes. Insights gained will be used to create a marketing strategy that can convert casual riders into annual members. \n","\n","\n","**What features/characteristics/value propositions are necessary to convert Cyclistic's casual riders into annual members?**\n","\n","\n","##### Key Stakeholders \n","**Primary Stakeholders**\n","1. Marketing Manager - Moreno, needs to ensure marketing strategy is aligned to overall business objectives - future growth. Needs clear and accurate insights to develop campaigns and other initiatives. \n","2. Executive Team - Detail-oriented, documentation will be important, this should be presented in the most easy to absorb way, with questions anticpated and ready to be answered. \n","\n","**Seconday Stakeholders**\n","1. Analytics Team - Insights gathered by individual team members needs to be cohesive and contribute to acheiving overall project goal. Communication is mandatory.  \n"]},{"cell_type":"markdown","id":"dc459c89","metadata":{"papermill":{"duration":0.154706,"end_time":"2022-02-08T15:43:41.424081","exception":false,"start_time":"2022-02-08T15:43:41.269375","status":"completed"},"tags":[]},"source":["## PHASE 2 - DATA PREPARATION <a class=\"anchor\" id=\"DATA PREPARATION\"></a>\n","\n","#### 1. Determine how data is organized and credibility\n","\n","\n","The data being used for anaysis is public data made available by Motivate International Inc under this [license](https://ride.divvybikes.com/data-license-agreement) and comprises of monthly cvs files. However, i will be using a version that was already stored on Kaggle. The data is primary data, collected by the company and is highly annonymize as there are no personal information about riders such as name, sex, age, address etc. The data appears to be credible and free from bias as it represents a population of all their customers' rides. Additionally, at first glimpse of the files using Excel, all columns seem to have consistent names and data-types.\n"]},{"cell_type":"markdown","id":"e57d0be2","metadata":{"papermill":{"duration":0.152536,"end_time":"2022-02-08T15:43:41.729886","exception":false,"start_time":"2022-02-08T15:43:41.57735","status":"completed"},"tags":[]},"source":["## PHASE 3 - DATA PROCESSING <a class=\"anchor\" id=\"DATA PROCESSING\"></a>\n","\n","#### 1. Documentation of cleaning and manipulation process. \n","\n","I will be using the Programming Language 'R' in the following steps to investigate and clean the data. This will help to ensure data integrity and all steps will be commented as part of the code. R's ability to clean, document, analyze and visualize data makes it my prefered tool for this project. \n","\n","\n"]},{"cell_type":"code","execution_count":1,"id":"58c71eb5","metadata":{"execution":{"iopub.execute_input":"2022-02-08T15:43:42.048754Z","iopub.status.busy":"2022-02-08T15:43:42.044115Z","iopub.status.idle":"2022-02-08T15:43:43.54188Z","shell.execute_reply":"2022-02-08T15:43:43.540314Z"},"papermill":{"duration":1.65628,"end_time":"2022-02-08T15:43:43.542095","exception":false,"start_time":"2022-02-08T15:43:41.885815","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────