ins. \n","3. While the longest members' ride was approximately one day, casual rides saw a max duration of approximately 38 days.\n","4. On weekends, casual rides peaked. Weekend rides accounted for 46.4% of the total casual rides for 2021.\n","5. Members' rides stayed consistent during the year, however, at summer(Jun-Sep), casual rides accounted for 63.8% of the total casual rides for the year.\n","6. Classic Bikes are the most ridden among both Cyclistic's member and casual riders. \n","7. Finally, casual riders had a most popular route of Street Drive & Grand Avenue which is close to popular tourist attractions, while member riders most popular route was around Ellis Ave. \n","\n"]},{"cell_type":"markdown","id":"1f2e5119","metadata":{"papermill":{"duration":0.310135,"end_time":"2022-02-08T15:52:14.115591","exception":false,"start_time":"2022-02-08T15:52:13.805456","status":"completed"},"tags":[]},"source":["## PHASE 6 - ACT <a class=\"anchor\" id=\"ACT\"></a>"]},{"cell_type":"markdown","id":"c3e3415b","metadata":{"papermill":{"duration":0.306818,"end_time":"2022-02-08T15:52:14.728706","exception":false,"start_time":"2022-02-08T15:52:14.421888","status":"completed"},"tags":[]},"source":["The data presented some limitations. For instance, users' information such as location, sex, or age would have helped to clearly defined a target market and a specific product offering for the marketing campaign. Additionally, with COVID being a huge factor affectiong most social and outdoor activities, Pre COVID years may need to be assessed for a better undertanding of the company's position. Given the findings, reccommendations to convert casual riders into Cyclistic members are as follows;\n","\n","**1. Determine if there are casual customers who use the bikes continously during the weeks and communicate to them about the benefits of becoming an annual member. This could be in terms of potential savings and unlimited rides up to approximately 30 mins. The company will need to ensure that there are enough Classic bikes available to meet the demand.**\n","\n","**2. Co-ordinate with businesses in the Tourism Industry to create a package for tourist to subscribe for an annual membership, such that they benefit from Cyclistic rides when in Chicago. This will appeal to the high influx of riders during summer and on weekends.**\n","\n","**3. Create flexible annual packages with flexible prices, for instance (weekly, monthly and weekends only packages), with options to skip or convert between packages.** \n","\n","**Generally, Cyclistic can seek ways to introduce a point base / rewards system, that can be used to build their customer's loyalty.**\n","\n","\n","This was my first project, ALL feedback is greatly appreciated. THANK YOU ALL @GOOGLE AND @KAGGLE.\n","\n","\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":517.997633,"end_time":"2022-02-08T15:52:15.371436","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-02-08T15:43:37.373803","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}